UPDATE bikes
SET 
    mileage = COALESCE(mileage,
        CASE
            WHEN type = 'Commuter' THEN 65
            WHEN type = 'Standard' THEN 45
            WHEN type = 'Sports' THEN 32
            WHEN type = 'Naked' THEN 28
            WHEN type = 'Cruiser' THEN 35
            WHEN type = 'Adventure' THEN 25
            WHEN type = 'Tourer' THEN 18
            WHEN type = 'Superbike' THEN 15
            WHEN type = 'Moped' THEN 75
            ELSE 30
        END),

    top_speed = COALESCE(top_speed,
        CASE
            WHEN type = 'Commuter' THEN 100
            WHEN type = 'Standard' THEN 125
            WHEN type = 'Sports' THEN 165
            WHEN type = 'Naked' THEN 170
            WHEN type = 'Cruiser' THEN 135
            WHEN type = 'Adventure' THEN 165
            WHEN type = 'Tourer' THEN 200
            WHEN type = 'Superbike' THEN 300
            WHEN type = 'Moped' THEN 70
            ELSE 120
        END),

    weight = COALESCE(weight,
        CASE
            WHEN type = 'Commuter' THEN 120
            WHEN type = 'Standard' THEN 155
            WHEN type = 'Sports' THEN 175
            WHEN type = 'Naked' THEN 170
            WHEN type = 'Cruiser' THEN 200
            WHEN type = 'Adventure' THEN 210
            WHEN type = 'Tourer' THEN 300
            WHEN type = 'Superbike' THEN 205
            WHEN type = 'Moped' THEN 90
            ELSE 150
        END),

    fuel_capacity = COALESCE(fuel_capacity,
        CASE
            WHEN type = 'Commuter' THEN 11
            WHEN type = 'Standard' THEN 13
            WHEN type = 'Sports' THEN 14
            WHEN type = 'Naked' THEN 14
            WHEN type = 'Cruiser' THEN 15
            WHEN type = 'Adventure' THEN 18
            WHEN type = 'Tourer' THEN 22
            WHEN type = 'Superbike' THEN 17
            WHEN type = 'Moped' THEN 5
            ELSE 12
        END),

    gears = COALESCE(gears,
        CASE
            WHEN type = 'Commuter' THEN 5
            WHEN type = 'Standard' THEN 5
            WHEN type = 'Sports' THEN 6
            WHEN type = 'Naked' THEN 6
            WHEN type = 'Cruiser' THEN 5
            WHEN type = 'Adventure' THEN 6
            WHEN type = 'Tourer' THEN 6
            WHEN type = 'Superbike' THEN 6
            WHEN type = 'Moped' THEN 4
            ELSE 5
        END),

    color_options = COALESCE(color_options, 'Black,Red,Blue');
